import { createGlobalStyle } from 'styled-components';

export default createGlobalStyle`
    *{
        padding: 0;
        margin: 0;
        
    }
    body{
        background: #cccc;
        font-family: 'Chango', cursive;
        background-image: url(data:image/jpeg;base64,);
        background-repeat: no-repeat;
    }

`
